export const traderProfiles = {
  dayTrader: {
    layout: [
      { 
        i: 'chart', 
        x: 0,          // Must be number
        y: 0,          // Must be number  
        w: 8,          // Must be number
        h: 8,          // Must be number
        minW: 2,       // Optional but must be number if present
        maxW: 12       // Optional but must be number if present
      },
      { 
        i: 'orderbook', 
        x: 8, 
        y: 0, 
        w: 4, 
        h: 4 
      }
    ],
    widgets: [
      { i: 'chart', type: 'chart' },
      { i: 'orderbook', type: 'orderbook' }
    ]
  }
};
